function remoteArticle(article, action){
	
	const old_reference = database.ref([
		DEBUG ? 'DEBUG' : article.old.location,
		article.old.category,
		article.old.id
	].join('/'))
	
	const reference = database.ref([
		DEBUG ? 'DEBUG' : article.public.location,
		article.public.category,
		article.public.id
	].join('/'))
	
	if(reference != old_reference) old_reference.remove()

	switch(action){
		case 'publish':
			if(article.public.title=='Untitled Article') return

			let article_remote = {}

			for(const [local,remote,_] of map)
				if(local && remote)
					article_remote[remote] = article.public[local]
					
			reference.update(article_remote)
			article.published = true
			
			remoteNotif(article,article.public.notify ? 'publish' : 'remove')
			postWebhook(article)
			
			article.old = Object.assign({},article.public)
			break
		case 'remove':
			reference.remove()
			remoteNotif(article,'remove')
			article.published = false
			break
	}
}

async function remoteNotif(article, action){

	const reference = database.ref([
		DEBUG ? 'DEBUG-notifs' : 'notifications',
		article.public.id
	].join('/'))
		
	switch(action){
		case 'publish':
			
			// Send push notification to FCM if one doesn't already exist
			const push = (article.public.notify == article.old.notify)

			// Upload notification to Realtime Database
			let notif_remote = {}
			
			const topicIndex = article.public.location == 'homepage'
			? locations.homepage.indexOf(article.public.category)+1
			: article.public.location == 'bulletin'
			? 4
			: null

			const topic = [
				'mandatory',
				'general',
				'asb',
				'district',
				'bulletin',
				'testing',
			][topicIndex || 5]

			for(const [local,_,remote] of map)
				if(local && remote){					
					switch(local){
						case 'category':
							notif_remote[remote] = topicIndex
							break
						case 'timestamp':
							if(push){
								notif_remote[remote] = getTimestamp()
								break
							}
						default: 
							notif_remote[remote] = article.public[local]
					}
				}
			
			reference.update(notif_remote)
			
			if(push) break
			const payload = {
				notification:{
					title: article.public.title,
					body: article.public.notif,
				},
				data:{
					articleID: article.public.id, 
				},
				to: '/topics/'+topic,
			}
			const response = await fetch(
				'https://fcm.googleapis.com/fcm/send',
				{
					method: 'POST',
					headers: {
						'Authorization': secrets.messaging,
						'Content-Type': 'application/json',
					},
					body: JSON.stringify(payload),
				}
			)
			console.log(payload,response)
			break
		case 'remove':
			reference.remove()
			break
	}
}
/////////////
/* WEBHOOK */
/////////////

async function postWebhook(article){
	let diffs = []
	for(const [property] of map)
		if(article.public[property] != article.old[property])
			diffs.push(property)
	if(!diffs.length) return false

	const payload = {
		username: 'ACES edit log',
		avatar_url: 'https://internal.ahs.app/icon.png',
		content: '',
		embeds: [{
			color: 11730954,
			author: {
				name: user.email,
			},
			title: `New changes to ${article.public.title}`,
			url: `https://internal.ahs.app/editor?id=${article.public.id}`,
			description: `Modified properties: ${diffs.join(', ') || 'None'}.`,
			footer: {
				text: `${article.public.location} > ${article.public.category}`,
			},			
		}],
	}
	const response = await fetch(
		secrets.webhook,
		{
			headers: {
				'Content-Type': 'application/json'
			},
			method: 'POST',
			body: JSON.stringify(payload),
		},
	)
	console.log(response)
}